const Footer = () => {
  return <footer className={'bg-primary py-12'}>
    <div className="container mx-auto">
      <p className={'text-white text-center'}>
        Copyright &copy; FPT Polytechnic(Le Hoang Nhat PH13941)
      </p>
    </div>
  </footer>;
};

export default Footer;
